# HashSet in std::collections - Rust

```
pub struct HashSet<T, S = RandomState> { /* private fields */ }
```

Expand description

A [hash set](about:blank/index.html#use-the-set-variant-of-any-of-these-maps-when "mod std::collections") implemented as a `HashMap` where the value is `()`.

As with the [`HashMap`](hash_map/struct.HashMap.html "struct std::collections::hash_map::HashMap") type, a `HashSet` requires that the elements implement the [`Eq`](../cmp/trait.Eq.html "trait std::cmp::Eq") and [`Hash`](../hash/trait.Hash.html "trait std::hash::Hash") traits. This can frequently be achieved by using `#[derive(PartialEq, Eq, Hash)]`. If you implement these yourself, it is important that the following property holds:

```text
k1 == k2 -> hash(k1) == hash(k2)

```

In other words, if two keys are equal, their hashes must be equal. Violating this property is a logic error.

It is also a logic error for a key to be modified in such a way that the keyâ€™s hash, as determined by the [`Hash`](../hash/trait.Hash.html "trait std::hash::Hash") trait, or its equality, as determined by the [`Eq`](../cmp/trait.Eq.html "trait std::cmp::Eq") trait, changes while it is in the map. This is normally only possible through [`Cell`](../cell/struct.Cell.html "struct std::cell::Cell"), [`RefCell`](../cell/struct.RefCell.html "struct std::cell::RefCell"), global state, I/O, or unsafe code.

The behavior resulting from either logic error is not specified, but will be encapsulated to the `HashSet` that observed the logic error and not result in undefined behavior. This could include panics, incorrect results, aborts, memory leaks, and non-termination.

## [Â§](#examples)Examples

```
use std::collections::HashSet;
// Type inference lets us omit an explicit type signature (which
// would be `HashSet<String>` in this example).
let mut books = HashSet::new();

// Add some books.
books.insert("A Dance With Dragons".to_string());
books.insert("To Kill a Mockingbird".to_string());
books.insert("The Odyssey".to_string());
books.insert("The Great Gatsby".to_string());

// Check for a specific one.
if !books.contains("The Winds of Winter") {
    println!("We have {} books, but The Winds of Winter ain't one.",
             books.len());
}

// Remove a book.
books.remove("The Odyssey");

// Iterate over everything.
for book in &books {
    println!("{book}");
}
```

