The easiest way to use `HashSet` with a custom type is to derive [`Eq`](../cmp/trait.Eq.html "trait std::cmp::Eq") and [`Hash`](../hash/trait.Hash.html "trait std::hash::Hash"). We must also derive [`PartialEq`](../cmp/trait.PartialEq.html "trait std::cmp::PartialEq"), which is required if [`Eq`](../cmp/trait.Eq.html "trait std::cmp::Eq") is derived.

```
use std::collections::HashSet;
#[derive(Hash, Eq, PartialEq, Debug)]
struct Viking {
    name: String,
    power: usize,
}

let mut vikings = HashSet::new();

vikings.insert(Viking { name: "Einar".to_string(), power: 9 });
vikings.insert(Viking { name: "Einar".to_string(), power: 9 });
vikings.insert(Viking { name: "Olaf".to_string(), power: 4 });
vikings.insert(Viking { name: "Harald".to_string(), power: 8 });

// Use derived implementation to print the vikings.
for x in &vikings {
    println!("{x:?}");
}
```

