1.6.0 Â· [source](about:blank/src/std/collections/hash/set.rs.html#256-258)

Clears the set, returning all elements as an iterator. Keeps the allocated memory for reuse.

If the returned iterator is dropped before being fully consumed, it drops the remaining elements. The returned iterator keeps a mutable borrow on the set to optimize its implementation.

##### [Â§](#examples-7)Examples

```
use std::collections::HashSet;

let mut set = HashSet::from([1, 2, 3]);
assert!(!set.is_empty());

// print 1, 2, 3 in an arbitrary order
for i in set.drain() {
    println!("{i}");
}

assert!(set.is_empty());
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++use+std::collections::HashSet;%0A++++%0A++++let+mut+set+=+HashSet::from(%5B1,+2,+3%5D);%0A++++assert!(!set.is_empty());%0A++++%0A++++//+print+1,+2,+3+in+an+arbitrary+order%0A++++for+i+in+set.drain()+%7B%0A++++++++println!(%22%7Bi%7D%22);%0A++++%7D%0A++++%0A++++assert!(set.is_empty());%0A%7D&edition=2021)

ðŸ”¬This is a nightly-only experimental API. (`hash_extract_if`Â [#59618](https://github.com/rust-lang/rust/issues/59618))

Creates an iterator which uses a closure to determine if a value should be removed.

If the closure returns true, then the value is removed and yielded. If the closure returns false, the value will remain in the list and will not be yielded by the iterator.

If the returned `ExtractIf` is not exhausted, e.g. because it is dropped without iterating or the iteration short-circuits, then the remaining elements will be retained. Use [`retain`](about:blank/hash_set/struct.HashSet.html#method.retain "method std::collections::hash_set::HashSet::retain") with a negated predicate if you do not need the returned iterator.

##### [Â§](#examples-8)Examples

Splitting a set into even and odd values, reusing the original set:

```
#![feature(hash_extract_if)]
use std::collections::HashSet;

let mut set: HashSet<i32> = (0..8).collect();
let extracted: HashSet<i32> = set.extract_if(|v| v % 2 == 0).collect();

let mut evens = extracted.into_iter().collect::<Vec<_>>();
let mut odds = set.into_iter().collect::<Vec<_>>();
evens.sort();
odds.sort();

assert_eq!(evens, vec![0, 2, 4, 6]);
assert_eq!(odds, vec![1, 3, 5, 7]);
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0A%23!%5Bfeature(hash_extract_if)%5D%0Afn+main()+%7B%0A++++use+std::collections::HashSet;%0A++++%0A++++let+mut+set:+HashSet%3Ci32%3E+=+(0..8).collect();%0A++++let+extracted:+HashSet%3Ci32%3E+=+set.extract_if(%7Cv%7C+v+%25+2+==+0).collect();%0A++++%0A++++let+mut+evens+=+extracted.into_iter().collect::%3CVec%3C_%3E%3E();%0A++++let+mut+odds+=+set.into_iter().collect::%3CVec%3C_%3E%3E();%0A++++evens.sort();%0A++++odds.sort();%0A++++%0A++++assert_eq!(evens,+vec!%5B0,+2,+4,+6%5D);%0A++++assert_eq!(odds,+vec!%5B1,+3,+5,+7%5D);%0A%7D&version=nightly&edition=2021)

