1.7.0 (const: [unstable](https://github.com/rust-lang/rust/issues/102575 "Tracking issue for const_collections_with_hasher")) Â· [source](about:blank/src/std/collections/hash/set.rs.html#373-375)

Creates a new empty hash set which will use the given hasher to hash keys.

The hash set is also created with the default initial capacity.

Warning: `hasher` is normally randomly generated, and is designed to allow `HashSet`s to be resistant to attacks that cause many collisions and very poor performance. Setting it manually using this function can expose a DoS attack vector.

The `hash_builder` passed should implement the [`BuildHasher`](../hash/trait.BuildHasher.html "trait std::hash::BuildHasher") trait for the HashMap to be useful, see its documentation for details.

##### [Â§](#examples-11)Examples

